import React, { useState } from 'react';
import {
  Box,
  Container,
  TextField,
  Button,
  Grid,
  Typography,
  Paper,
  InputAdornment,
  Tabs,
  Tab,
  Chip,
  Avatar,
  Autocomplete,
} from '@mui/material';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import dayjs from 'dayjs';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
import DirectionsBusIcon from '@mui/icons-material/DirectionsBus';
import TrainIcon from '@mui/icons-material/Train';
import FlightIcon from '@mui/icons-material/Flight';
import WifiIcon from '@mui/icons-material/Wifi';
import PowerIcon from '@mui/icons-material/Power';
import RestaurantIcon from '@mui/icons-material/Restaurant';
import AcUnitIcon from '@mui/icons-material/AcUnit';
import HotelIcon from '@mui/icons-material/Hotel';
import LocalDrinkIcon from '@mui/icons-material/LocalDrink';

const Home = () => {
  // Cities data
  const cities = [
    'Amalapuram',
    'Hyderabad',
    'Vijayawada',
    'Bangalore',
    'Chennai',
    'Mumbai',
    'Delhi',
    'Kolkata',
    'Pune',
    'Visakhapatnam',
    'Rajahmundry',
    'Kakinada',
  ];

  const [searchParams, setSearchParams] = useState({
    from: '',
    to: '',
    date: dayjs(),
  });

  const [searchResults, setSearchResults] = useState(null);
  const [activeTab, setActiveTab] = useState('all');

  const handleSearch = (e) => {
    e.preventDefault();
    // Mock data for demonstration
    const mockResults = {
      bus: [
        {
          type: 'bus',
          name: 'Express Deluxe',
          operator: 'State Express',
          departure: '08:00',
          arrival: '16:00',
          duration: '8h 0m',
          price: 600,
          features: ['AC', 'Sleeper', 'Water Bottle', 'Charging Point'],
        },
        {
          type: 'bus',
          name: 'Luxury AC',
          operator: 'Private Travels',
          departure: '21:00',
          arrival: '05:00',
          duration: '8h 0m',
          price: 800,
          features: ['AC', 'Sleeper', 'Blanket', 'Charging Point', 'WiFi'],
        },
      ],
      train: [
        {
          type: 'train',
          name: 'Godavari Express',
          operator: 'Indian Railways',
          departure: '19:30',
          arrival: '06:15',
          duration: '10h 45m',
          price: 450,
          features: ['Sleeper Class', 'Food Available', 'Charging Point'],
        },
      ],
      flight: [
        {
          type: 'flight',
          name: 'Quick Air',
          operator: 'Quick Airways',
          departure: '10:00',
          arrival: '11:30',
          duration: '1.5h',
          price: 3800,
          features: ['Meal', 'Baggage 15kg'],
        },
      ],
    };
    setSearchResults(mockResults);
  };

  const getFeatureIcon = (feature) => {
    switch (feature.toLowerCase()) {
      case 'ac':
        return <AcUnitIcon fontSize="small" />;
      case 'wifi':
        return <WifiIcon fontSize="small" />;
      case 'charging point':
        return <PowerIcon fontSize="small" />;
      case 'food available':
        return <RestaurantIcon fontSize="small" />;
      case 'sleeper':
      case 'sleeper class':
        return <HotelIcon fontSize="small" />;
      case 'water bottle':
        return <LocalDrinkIcon fontSize="small" />;
      default:
        return null;
    }
  };

  const getTransportIcon = (type) => {
    switch (type) {
      case 'bus':
        return <DirectionsBusIcon sx={{ fontSize: 40 }} />;
      case 'train':
        return <TrainIcon sx={{ fontSize: 40 }} />;
      case 'flight':
        return <FlightIcon sx={{ fontSize: 40 }} />;
      default:
        return null;
    }
  };

  const getTransportColor = (type) => {
    switch (type) {
      case 'bus':
        return '#E3F2FD';
      case 'train':
        return '#E8F5E9';
      case 'flight':
        return '#F3E5F5';
      default:
        return '#E3F2FD';
    }
  };

  const renderSearchResults = () => {
    if (!searchResults) return null;

    const allOptions = [
      ...searchResults.bus,
      ...searchResults.train,
      ...searchResults.flight,
    ];

    const filteredOptions = activeTab === 'all' 
      ? allOptions 
      : allOptions.filter(option => option.type === activeTab);

    return (
      <Box sx={{ mt: 4, backgroundColor: 'white', borderRadius: 2, p: 3 }}>
        <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 3 }}>
          <Tabs 
            value={activeTab} 
            onChange={(e, newValue) => setActiveTab(newValue)}
            sx={{
              '& .MuiTab-root': {
                textTransform: 'none',
                fontSize: '1rem',
              },
            }}
          >
            <Tab label="All Options" value="all" />
            <Tab label="Bus" value="bus" />
            <Tab label="Train" value="train" />
            <Tab label="Flight" value="flight" />
          </Tabs>
        </Box>

        {/* Transport Type Summary */}
        {activeTab === 'all' && (
          <Grid container spacing={3} sx={{ mb: 4 }}>
            <Grid item xs={12} md={4}>
              <Paper 
                elevation={0} 
                sx={{ 
                  p: 2, 
                  backgroundColor: '#E3F2FD',
                  borderRadius: 2,
                  display: 'flex',
                  alignItems: 'center',
                  gap: 2
                }}
              >
                <Avatar sx={{ backgroundColor: 'white' }}>
                  <DirectionsBusIcon color="primary" />
                </Avatar>
                <Box>
                  <Typography variant="subtitle1" fontWeight="bold">Bus</Typography>
                  <Typography variant="body2" color="text.secondary">
                    Approx. 8h journey
                  </Typography>
                  <Typography variant="subtitle2">₹600 - ₹800</Typography>
                </Box>
              </Paper>
            </Grid>
            <Grid item xs={12} md={4}>
              <Paper 
                elevation={0} 
                sx={{ 
                  p: 2, 
                  backgroundColor: '#E8F5E9',
                  borderRadius: 2,
                  display: 'flex',
                  alignItems: 'center',
                  gap: 2
                }}
              >
                <Avatar sx={{ backgroundColor: 'white' }}>
                  <TrainIcon color="primary" />
                </Avatar>
                <Box>
                  <Typography variant="subtitle1" fontWeight="bold">Train</Typography>
                  <Typography variant="body2" color="text.secondary">
                    Approx. 10h journey
                  </Typography>
                  <Typography variant="subtitle2">₹450 - ₹1200</Typography>
                </Box>
              </Paper>
            </Grid>
            <Grid item xs={12} md={4}>
              <Paper 
                elevation={0} 
                sx={{ 
                  p: 2, 
                  backgroundColor: '#F3E5F5',
                  borderRadius: 2,
                  display: 'flex',
                  alignItems: 'center',
                  gap: 2
                }}
              >
                <Avatar sx={{ backgroundColor: 'white' }}>
                  <FlightIcon color="primary" />
                </Avatar>
                <Box>
                  <Typography variant="subtitle1" fontWeight="bold">Flight</Typography>
                  <Typography variant="body2" color="text.secondary">
                    Approx. 1.5h journey
                  </Typography>
                  <Typography variant="subtitle2">₹3800 - ₹4500</Typography>
                </Box>
              </Paper>
            </Grid>
          </Grid>
        )}

        {/* Transport Options */}
        <Grid container spacing={3}>
          {filteredOptions.map((option, index) => (
            <Grid item xs={12} key={index}>
              <Paper 
                elevation={1} 
                sx={{ 
                  p: 3,
                  borderRadius: 2,
                  '&:hover': {
                    boxShadow: 3,
                  },
                }}
              >
                <Grid container spacing={2} alignItems="center">
                  <Grid item xs={12} md={0.7}>
                    <Avatar 
                      sx={{ 
                        width: 56, 
                        height: 56, 
                        backgroundColor: getTransportColor(option.type)
                      }}
                    >
                      {getTransportIcon(option.type)}
                    </Avatar>
                  </Grid>
                  <Grid item xs={12} md={2.3}>
                    <Typography variant="h6" sx={{ fontWeight: 600 }}>
                      {option.name}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      {option.operator}
                    </Typography>
                  </Grid>
                  <Grid item xs={12} md={3}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <Box>
                        <Typography variant="h6">{option.departure}</Typography>
                        <Typography variant="body2">Departure</Typography>
                      </Box>
                      <Box sx={{ flex: 1, textAlign: 'center', px: 2 }}>
                        <Typography variant="body2" color="text.secondary">
                          {option.duration}
                        </Typography>
                      </Box>
                      <Box>
                        <Typography variant="h6">{option.arrival}</Typography>
                        <Typography variant="body2">Arrival</Typography>
                      </Box>
                    </Box>
                  </Grid>
                  <Grid item xs={12} md={3}>
                    <Typography variant="subtitle1" gutterBottom>
                      Features:
                    </Typography>
                    <Box sx={{ display: 'flex', gap: 1, flexWrap: 'wrap' }}>
                      {option.features.map((feature, idx) => (
                        <Chip
                          key={idx}
                          icon={getFeatureIcon(feature)}
                          label={feature}
                          size="small"
                          variant="outlined"
                        />
                      ))}
                    </Box>
                  </Grid>
                  <Grid item xs={12} md={1.5}>
                    <Typography variant="h5" color="primary" sx={{ fontWeight: 600 }}>
                      ₹{option.price}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      per person
                    </Typography>
                  </Grid>
                  <Grid item xs={12} md={1.5}>
                    <Button
                      variant="contained"
                      fullWidth
                      sx={{
                        height: '48px',
                        fontSize: '1rem',
                      }}
                    >
                      Book Now
                    </Button>
                  </Grid>
                </Grid>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Box>
    );
  };

  return (
    <Box
      sx={{
        background: 'linear-gradient(135deg, #1a73e8 0%, #0d47a1 100%)',
        minHeight: '100vh',
        pt: { xs: 4, md: 12 },
        pb: { xs: 6, md: 12 },
      }}
    >
      <Container maxWidth="lg">
        <Box sx={{ textAlign: 'center', color: 'white', mb: { xs: 4, md: 8 } }}>
          <Typography 
            variant="h2" 
            component="h1" 
            gutterBottom 
            fontWeight="bold"
            sx={{
              fontSize: { xs: '2rem', sm: '2.5rem', md: '3.5rem' },
              mb: 3
            }}
          >
            Compare & Book Travel Tickets
          </Typography>
          <Typography 
            variant="h5" 
            sx={{ 
              opacity: 0.9,
              fontSize: { xs: '1rem', sm: '1.25rem', md: '1.5rem' },
              maxWidth: '800px',
              margin: '0 auto'
            }}
          >
            Find the best deals on bus, train, and flight tickets all in one place
          </Typography>
        </Box>

        <Paper
          elevation={3}
          sx={{
            p: { xs: 2, sm: 3, md: 6 },
            borderRadius: 4,
            backgroundColor: 'rgba(255, 255, 255, 0.98)',
            maxWidth: '1000px',
            margin: '0 auto',
            boxShadow: '0 8px 32px rgba(0,0,0,0.1)',
          }}
        >
          <form onSubmit={handleSearch}>
            <Grid container spacing={4}>
              <Grid item xs={12} md={4}>
                <Typography 
                  variant="subtitle1" 
                  gutterBottom 
                  sx={{ 
                    ml: 1,
                    fontWeight: 500,
                    color: 'text.primary' 
                  }}
                >
                  From
                </Typography>
                <Autocomplete
                  freeSolo
                  options={cities}
                  value={searchParams.from}
                  onChange={(event, newValue) => {
                    setSearchParams({ ...searchParams, from: newValue || '' });
                  }}
                  renderInput={(params) => (
                    <TextField
                      {...params}
                      fullWidth
                      placeholder="Enter city"
                      InputProps={{
                        ...params.InputProps,
                        startAdornment: (
                          <InputAdornment position="start">
                            <LocationOnIcon color="primary" />
                          </InputAdornment>
                        ),
                      }}
                      sx={{
                        '& .MuiOutlinedInput-root': {
                          borderRadius: 3,
                          height: '56px',
                          backgroundColor: '#f8faff',
                          '&:hover': {
                            backgroundColor: '#f5f7ff',
                          },
                          '&.Mui-focused': {
                            backgroundColor: '#ffffff',
                          }
                        },
                      }}
                    />
                  )}
                  ListboxProps={{
                    sx: {
                      maxHeight: '250px',
                      '& .MuiAutocomplete-option': {
                        padding: '12px 16px',
                        '&:hover': {
                          backgroundColor: '#f5f7ff',
                        }
                      },
                    },
                  }}
                />
              </Grid>

              <Grid item xs={12} md={4}>
                <Typography 
                  variant="subtitle1" 
                  gutterBottom 
                  sx={{ 
                    ml: 1,
                    fontWeight: 500,
                    color: 'text.primary' 
                  }}
                >
                  To
                </Typography>
                <Autocomplete
                  freeSolo
                  options={cities}
                  value={searchParams.to}
                  onChange={(event, newValue) => {
                    setSearchParams({ ...searchParams, to: newValue || '' });
                  }}
                  renderInput={(params) => (
                    <TextField
                      {...params}
                      fullWidth
                      placeholder="Enter city"
                      InputProps={{
                        ...params.InputProps,
                        startAdornment: (
                          <InputAdornment position="start">
                            <LocationOnIcon color="primary" />
                          </InputAdornment>
                        ),
                      }}
                      sx={{
                        '& .MuiOutlinedInput-root': {
                          borderRadius: 3,
                          height: '56px',
                          backgroundColor: '#f8faff',
                          '&:hover': {
                            backgroundColor: '#f5f7ff',
                          },
                          '&.Mui-focused': {
                            backgroundColor: '#ffffff',
                          }
                        },
                      }}
                    />
                  )}
                  ListboxProps={{
                    sx: {
                      maxHeight: '250px',
                      '& .MuiAutocomplete-option': {
                        padding: '12px 16px',
                        '&:hover': {
                          backgroundColor: '#f5f7ff',
                        }
                      },
                    },
                  }}
                />
              </Grid>

              <Grid item xs={12} md={4}>
                <Typography 
                  variant="subtitle1" 
                  gutterBottom 
                  sx={{ 
                    ml: 1,
                    fontWeight: 500,
                    color: 'text.primary' 
                  }}
                >
                  Date
                </Typography>
                <LocalizationProvider dateAdapter={AdapterDayjs}>
                  <DatePicker
                    value={searchParams.date}
                    onChange={(newValue) => setSearchParams({ ...searchParams, date: newValue })}
                    slotProps={{
                      textField: {
                        fullWidth: true,
                        InputProps: {
                          startAdornment: (
                            <InputAdornment position="start">
                              <CalendarTodayIcon color="primary" />
                            </InputAdornment>
                          ),
                        },
                        sx: {
                          '& .MuiOutlinedInput-root': {
                            borderRadius: 3,
                            height: '56px',
                            backgroundColor: '#f8faff',
                            '&:hover': {
                              backgroundColor: '#f5f7ff',
                            },
                            '&.Mui-focused': {
                              backgroundColor: '#ffffff',
                            }
                          },
                        },
                      },
                    }}
                  />
                </LocalizationProvider>
              </Grid>

              <Grid item xs={12}>
                <Button
                  type="submit"
                  variant="contained"
                  fullWidth
                  size="large"
                  sx={{
                    mt: { xs: 2, md: 3 },
                    height: 56,
                    borderRadius: 3,
                    backgroundColor: '#1a73e8',
                    '&:hover': {
                      backgroundColor: '#1557b0',
                    },
                    fontSize: '1.1rem',
                    textTransform: 'none',
                    boxShadow: '0 4px 12px rgba(26,115,232,0.4)',
                  }}
                >
                  Search Tickets
                </Button>
              </Grid>
            </Grid>
          </form>
        </Paper>

        {renderSearchResults()}

        <Box sx={{ mt: { xs: 6, md: 12 }, textAlign: 'center', color: 'white' }}>
          <Typography 
            variant="h3" 
            gutterBottom
            sx={{
              fontSize: { xs: '1.75rem', sm: '2.25rem', md: '2.75rem' },
              fontWeight: 600
            }}
          >
            Why Choose Go-Ticket?
          </Typography>
          {/* Add your content for Why Choose section here */}
        </Box>
      </Container>
    </Box>
  );
};

export default Home;
